import numpy as np
from scipy.stats import gaussian_kde

probability_dataset = np.array(heat_data)
people_dataset = probability_dataset.copy()
people = np.random.randint(0, 100, size=people_dataset.shape[0])
people_dataset[:, 2] = people

people_latitudes = people_dataset[:, 0]
people_longitudes = people_dataset[:, 1]
people_values = people_dataset[:, 2]

probability_latitudes = probability_dataset[:, 0]
probability_longitudes = probability_dataset[:, 1]
probability_values = probability_dataset[:, 2]

# Perform kernel density estimation for both datasets
people_kde = gaussian_kde(np.vstack([people_latitudes, people_longitudes]), weights=people_values)
probability_kde = gaussian_kde(np.vstack([probability_latitudes, probability_longitudes]), weights=probability_values)

# Generate a grid of points covering the area of interest
grid_lat, grid_lng = np.meshgrid(np.linspace(min(people_latitudes), max(people_latitudes), 200),
                                 np.linspace(min(people_longitudes), max(people_longitudes), 200))

# Combine the density estimates from both datasets
combined_density = people_kde(np.vstack([grid_lat.ravel(), grid_lng.ravel()])) * \
                   probability_kde(np.vstack([grid_lat.ravel(), grid_lng.ravel()]))

# Create Folium map
m = folium.Map(location=[np.mean(people_latitudes), np.mean(people_longitudes)], zoom_start=10)

# Add heatmap layer
m.add_child(folium.plugins.HeatMap(
    list(zip(grid_lat.ravel(), grid_lng.ravel(), combined_density)),
    radius=10,
    max_zoom=15  # Adjust the max_zoom value as needed
))

# Save or display the map
m.save("combined_heatmap.html")

